import React from 'react';
import { BrowserRouter, Route, Switch  } from 'react-router'
import Landing from './pages/Landing/Landing';
import CovidCharts from './pages/CovidCharts/CovidCharts';

const  App = () => {
  return (
    <div>
      <BrowserRouter>
        <Switch>
          <Route exact path='/'>
            <Landing/>
          </Route>
          <Route exact path='/CovidCharts'>
            <CovidCharts/>
          </Route>
        </Switch>
      </BrowserRouter>

    </div>
  );
}

export default App;
